%%
%[text] $H=\\mathbf{d}\\cdot\\mathbf{\\sigma},\n\\mathbf{d}=\\left(A\\sin k\_x, A \\sin k\_y, M-4B\\sin^2\\frac{k\_x a}{2}-4B\\sin^2\\frac{k\_y a}{2}\\right)$
%[text] $H=\\left\\lbrack \\begin{array}{cc}\n+\\left(M-4B\\;\\sin^2 \\frac{k\_x \\;a}{2}-4B\\;\\sin^2 \\frac{k\_y a}{2}\\right) & A\\;{\\sin \\;k}\_x -i\\;A\\;\\sin \\;k\_y \\\\\nA\\;{\\sin \\;k}\_x +i\\;A\\;\\sin \\;k\_y  & -\\left(M-4B\\;\\sin^2 \\frac{k\_x \\;a}{2}-4B\\;\\sin^2 \\frac{k\_y a}{2}\\right)\n\\end{array}\\right\\rbrack${"editStyle":"visual"}

clear ;clc;

%energy ------------------------------------- 
kx_step = 101;
kx = [-pi,pi];
kx_list = linspace(kx(1), kx(2),kx_step);

ky_step = 101;
ky = [-pi,pi];
ky_list = linspace(ky(1), ky(2),ky_step);

Energy_band = zeros(kx_step, ky_step, 2);
a = 1; A = 1; B = 1; M = 2*B; %a:lattice length ; 

H = @(kx, ky) [M - 4*B*sin(kx*a/2)*sin(kx*a/2)-4*B*sin(ky*a/2)*sin(ky*a/2),A*sin(kx*a)-sqrt(-1)*A*sin(ky*a);
            A*sin(kx*a)+sqrt(-1)*A*sin(ky*a),-(M-4*B*sin(kx*a/2)*sin(kx*a/2)-4*B*sin(ky*a/2)*sin(ky*a/2))];
for ii = 1:kx_step
    for jj = 1:ky_step
        Energy_band(ii,jj,:) = eig(H(kx_list(ii), ky_list(jj)));
    end
end
[KX, KY] = meshgrid(kx_list, ky_list);
figure %[output:58907ba7]
mesh(KX, KY, Energy_band(:, :, 1)); %[output:58907ba7]
hold on  %[output:58907ba7]
mesh(KX, KY, Energy_band(:, :, 2)); %[output:58907ba7]
hold off %[output:58907ba7]
xlabel('k_x') %[output:58907ba7]
ylabel('k_y') %[output:58907ba7]
zlabel('E') %[output:58907ba7]
E1=reshape(Energy_band(:,:,1),[kx_step,ky_step]);
E2=reshape(Energy_band(:,:,2),[kx_step,ky_step]);
figure %[output:2148d9e0]

%Dos_Ene(X,Y,E1,E2,num,b);
subplot(1,3,1);hold on;xlabel('$k_x$','Interpreter','latex');ylabel('$E$','Interpreter','latex'); %[output:2148d9e0]
title('PBC','Interpreter','latex'); %[output:2148d9e0]
plot(kx_list, E1, '-r'); plot(kx_list, E2, '-r'); %[output:2148d9e0]
hold off; %[output:2148d9e0]


%edge state-------------------------------------------------
%x:PBC;y:OBC
h = zeros(2*ky_step,2*ky_step);
ene = zeros(kx_step,2*ky_step);
for ii=1:kx_step
    
    for jj=1:ky_step
        h(2*jj-1,2*jj-1)=M-2*B-4*B*sin(kx_list(ii)*a/2)*sin(kx_list(ii)*a/2);
        h(2*jj-1,2*jj)=A*sin(kx_list(ii)*a);
        h(2*jj,2*jj-1)=A*sin(kx_list(ii)*a);
        h(2*jj,2*jj)=-(M-2*B-4*B*sin(kx_list(ii)*a/2)*sin(kx_list(ii)*a/2));
    end
    for jj=1:ky_step-1
        h(2*jj-1,2*jj+1)=B;
        h(2*jj-1,2*jj+2)=-0.5*A;
        h(2*jj,2*jj+1)=0.5*A;
        h(2*jj,2*jj+2)=-B;
        
        h(2*jj+1,2*jj-1)=conj(h(2*jj-1,2*jj+1));
        h(2*jj+2,2*jj-1)=conj(h(2*jj-1,2*jj+2));
        h(2*jj+1,2*jj)=conj(h(2*jj,2*jj+1));
        h(2*jj+2,2*jj)=conj(h(2*jj,2*jj+2));
    end
    
    ene(ii,:)=eig(h);  %ene(16,30)
end
Kx=linspace(-pi,pi,kx_step);
subplot(1,3,2); %[output:2148d9e0]
plot(Kx,ene,'-b');xlabel('$k_x$','Interpreter','latex');ylabel('$E$','Interpreter','latex');title('OBC','Interpreter','latex'); %[output:2148d9e0]
%grid on;

% %wavefunction-------------------------------   
% %edge state     x:PBC;y:OBC
kx_step=30;  %nx:the number of k_x; ny:the number of lattice y-diraction
a=1;A=1;B=1;M=2*B;%a:lattice length ;
ii=16%n_x=16处为零能点，所以在此k_x下寻找边缘态波函数 %[output:351a4bf3]

kx=-pi+(ii-1)*2*pi/kx_step;
ky_step=100;
    for jj=1:ky_step
        h(2*jj-1,2*jj-1)=M-2*B-4*B*sin(kx*a/2)*sin(kx*a/2);
        h(2*jj-1,2*jj)=A*sin(kx*a);
        h(2*jj,2*jj-1)=A*sin(kx*a);
        h(2*jj,2*jj)=-(M-2*B-4*B*sin(kx*a/2)*sin(kx*a/2));
    end
    for jj=1:ky_step-1
        h(2*jj-1,2*jj+1)=B;
        h(2*jj-1,2*jj+2)=-0.5*A;
        h(2*jj,2*jj+1)=0.5*A;
        h(2*jj,2*jj+2)=-B;
        
        h(2*jj+1,2*jj-1)=conj(h(2*jj-1,2*jj+1));
        h(2*jj+2,2*jj-1)=conj(h(2*jj-1,2*jj+2));
        h(2*jj+1,2*jj)=conj(h(2*jj,2*jj+1));
        h(2*jj+2,2*jj)=conj(h(2*jj,2*jj+2));
    end
    [V,D]=eig(h);D=diag(D);
    
    %search D and find D==0,when n=100

    x=linspace(0,ky_step,length(V(:,1)));
%%
    subplot(1,3,3) %[output:5e072277]
    plot(x,V(:,99),x,V(:,100),x,V(:,101),x,V(:,102));legend('E=-1.0014','E=0','E=0','E=1.0014') %[output:5e072277]
    xlabel('y','Interpreter','latex'),ylabel('$\Psi$','Interpreter','latex');title('$M=2B$','Interpreter','latex'); %[output:5e072277]

